import Layout from '../components/PageLayout';
import React from 'react';
import axios from 'axios';


export default class Index extends React.Component {

  getCoords = 'http://localhost:3001/taras/coordinates';


  constructor(props) {
    super(props)
    this.state = {
      coords: []
    }

    this.changeVideo = this.changeVideo.bind(this);
  }

  componentDidMount() {
    this.handleSubmit();
  }

  changeVideo = (newUrl) => {
    this.setState({ url: newUrl, playing: true })
  }

  handleSubmit = async () => {
    fetch('http://localhost:3001/taras/coordinates')
    .then(res => res.json())
    .then(data => this.setState({ coords: data }));

  }

  render() {
    return (
      <div>

      </div>
    )
  }
}
